import './Table.css';
import axios from 'axios';

function Table(props) {

    const handleDelete = (e) => {

        axios.delete('/api/', e)
        .then(res => {
          if (res.data.message === "success"){
            props.getData()
          }
        })
        .catch(err=> console.log(err))
      }

      
  return (
    <div>
    <h1>Memo</h1>
    <table>
        <thead>
        <tr>
            <td className="date">Date</td>
            <td className="text">Notes</td>
            <td className="date">Delete</td>
        </tr>
        </thead>
        
        <tbody>
            {props.memos.map(t => 
        <tr>
            <td className="date">Date</td>
            <td className="text">{t.text}</td>
            <td>
                <div className='btn'>
                    <button onClick={_ =>handleDelete(t)}  className="button-85" role="button" >Delete</button>
                </div>
            </td>
        </tr>)}
        </tbody>
    </table>
    </div>
  );
}

export default Table;
